class Tree:
    def __init__(self, vertex: int, diameter: int, degree: int, vertices: int):
        self.vertex = vertex
        self.diameter = diameter
        self.degree = degree
        self.vertices = vertices

    def build(self) -> None:
        # build edges
        self.edges = []
        for i in range(2, self.vertices):
            self.edges.append(f"{self.vertex} {i}")

        # build degree
        for i in range(1, self.vertices):
            degree = 0
            for edge in self.edges:
                if edge[0] == self.vertex:
                    if edge[1] == i:
                        degree += 1
                if edge[1] == self.vertex:
                    if edge[0] == i:
                        degree += 1
            self.degree[i] = degree

        # build diameter
        self.diameter = 1
        for i in range(1, self.vertices):
            for j in range(1, self.vertices):
                if self.degree[i] + self.degree[j] <= self.diameter:
                    self.diameter = self.degree[i] + self.degree[j]

    def get_string(self) -> str:
        return "\n".join(self.edges)

