class Graph:
    def __init__(self, n):
        self.n = n
        self.edges = {i: set() for i in range(1, n + 1)}
        self.diameter = 0
        self.tree = True

    def add_edge(self, u, v):
        self.edges[u].add(v)
        self.edges[v].add(u)
        self.tree = False
        if len(self.edges[u]) == 1:
