        return True

    def bfs(start: tuple[int, int]) -> int:
        queue = deque([start])
        visited = set()
        steps = 0
        while queue:
            row, col = queue.popleft()
            if row == 0 or row == N - 1:
                return steps
            if (row, col) in visited:
                continue
            visited.add((row, col))
            if grid[row][col] == 'S':
